pragma solidity ^0.8.18;

import './ERC721Metadata.sol';
import './ERC721Enumerable.sol';

contract ERC721Connector is ERC721Metadata, ERC721Enumerable {

    /* Seteamos el connector entre los metadatos y el contrato principal*/
