        string memory name, 
        string memory symbol) 
        ERC721Metadata(name, symbol) {}
}

contracts/ERC721Enumerable.sol.content:
// SPDX-License-Identifier: MIT
// Author: @Zlatkowicz
pragma solidity ^0.8.18;

import './ERC721.sol';

contract ERC721Enumerable is ERC721 {
    uint256[] private _allTokens;

    mapping(uint256 => uint256) private _allTokensIndex;
    mapping(address => uint256[]) private _ownedTokens;
    mapping(uint256 => uint256) private _ownedTokensIndex;

    function totalSupply() external view returns(uint256) {
        return _allTokens.length;
    }

    function tokenByIndex(uint256 _index) external view returns(uint256) {}

    function tokenOfOwnerByIndex(address _owner, uint256 _index) external view returns(uint256){}

    function _mint(address to, uint256 tokenId) override(ERC721) internal {
        super._mint(to, tokenId);
        _addTokensToOwnerEnumeration(to, tokenId);
        _addTokensToAllTokenEnumeration(tokenId);
    }

    function _addTokensToAllTokenEnumeration(uint256 tokenId) private {
        _allTokensIndex[tokenId] = _allTokens.length;
        _allTokens.push(tokenId);
    }

    function _addTokensToOwnerEnumeration(address to, uint256 tokenId) private {
        _ownedTokensIndex[tokenId] = _ownedTokens[to].length;
        _ownedTokens[to].push(tokenId);
    }
}

contracts/ERC721Metadata.sol.content:
// SPDX-License-Identifier: MIT
// Author: @Zlatkowicz
pragma solidity ^0.8.18;

contract ERC721Metadata {
    string private _name;
    string private _symbol;

    constructor(string memory named, string memory symbolified) {
        _name = named;
        _symbol = symbolified;
    }

    function setName() external view returns(string memory) {
        return _name;
    }
    function setSymbol() external view returns(string memory) {
        return _symbol;
    }
}

contracts/Herbs.sol.content:
// SPDX-License-Identifier: MIT
// Author: @Zlatkowicz
pragma solidity ^0.8.18;

import './ERC721Connector.sol';

contract Herbs is ERC721Connector {
    
    // Matriz para guardar los nfts
    string[] public HerbsNFTS;

    mapping(string => bool) _herbsNFTExists;

    function mint(string memory _herbs) public {

        require(!_herbsNFTExists[_herbs], "ERROR - Token already Exists");

        HerbsNFTS.push(_herbs);
        uint _id = HerbsNFTS.length -1;

        _mint(msg.sender, _id);
        _herbsNFTExists[_herbs] = true;
    }
    
    constructor() ERC721Connector('Herbs', 'HERB') {
        
    } 
}

